import React from 'react';
import './Nav.css';

const Nav = () => {
    return(
        <div class="nav">
            <div class="hamburger">
                <span class="line line1"></span>
                <span class="line line2"></span>
            </div>
            <h3>Menu</h3>
            <ul>
                <li><a href="#secondPage">Who I Am</a></li>
                <li>Things I Do</li>
                <li>Talk To Me</li>
            </ul>
        </div>
    )
}

export default Nav;
